#!/usr/bin/env node

/**
 * Script t·∫°o icons cho Electron app
 * T·∫°o icon ƒë∆°n gi·∫£n cho tray v√† app
 */

const fs = require("fs");
const path = require("path");

// T·∫°o th∆∞ m·ª•c assets
const assetsDir = path.join(__dirname, "../assets");
if (!fs.existsSync(assetsDir)) {
  fs.mkdirSync(assetsDir, { recursive: true });
  console.log("üìÅ Created assets directory");
}

// Icon PNG original
const iconOriginalBase64 =
  "";

// Icon PNG 32x32 - Simple blue circle v·ªõi ch·ªØ T (base64)
const icon32Base64 =
  "";

// Icon PNG 16x16 cho macOS (base64)
const icon16Base64 =
  "";

// T·∫°o icon files
try {
  // Tray icon 32x32
  fs.writeFileSync(
    path.join(assetsDir, "tray-icon.png"),
    Buffer.from(icon32Base64, "base64")
  );
  console.log("‚úÖ Created tray-icon.png (32x32)");

  // App icon 32x32
  fs.writeFileSync(
    path.join(assetsDir, "icon.png"),
    Buffer.from(iconOriginalBase64, "base64")
  );
  console.log("‚úÖ Created icon.png (32x32)");

  // Tray icon 16x16 cho macOS
  fs.writeFileSync(
    path.join(assetsDir, "tray-icon@2x.png"),
    Buffer.from(icon16Base64, "base64")
  );
  console.log("‚úÖ Created tray-icon@2x.png (16x16)");

  console.log("üéâ All icons created successfully!");
} catch (error) {
  console.error("‚ùå Failed to create icons:", error);
  process.exit(1);
}
